import React, { useState } from 'react';
import { Button, TextField, Typography, Container, Grid, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';
import axios from 'axios';

interface RecordData {
  matchNumber: string;
  teamNumber: string;
}

const RemoveDataScreen: React.FC = () => {
  const [compCode, setCompCode] = useState<string>('');
  const [teamNumber, setTeamNumber] = useState<string>('');
  const [records, setRecords] = useState<RecordData[]>([]);
  const [responseMessage, setResponseMessage] = useState<string>('');

  const handleCompCodeChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setCompCode(event.target.value);
  };

  const handleTeamNumberChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setTeamNumber(event.target.value);
  };

  const handleSearch = async () => {
    try {
      const response = await axios.get(`http://localhost:8080/impi/${compCode}/${teamNumber}`);
      setRecords(response.data);
      setResponseMessage('');
    } catch (error) {
      console.error('Error fetching records:', error);
      setResponseMessage('Error fetching records');
    }
  };

  const handleDelete = async (matchNumber: string) => {
    try {
      await axios.delete(`http://localhost:8080/${compCode}/delete/${teamNumber}/${matchNumber}`);
      setRecords(records.filter(record => record.matchNumber !== matchNumber));
      setResponseMessage('Record deleted successfully');
    } catch (error) {
      console.error('Error deleting record:', error);
      setResponseMessage('Error deleting record');
    }
  };

  return (
    <Container>
      <Typography variant="h3" align="center" gutterBottom>
        Remove Data Screen
      </Typography>
      <Grid container justifyContent="center" spacing={2}>
        <Grid item>
          <TextField
            label="Competition Code"
            variant="outlined"
            value={compCode}
            onChange={handleCompCodeChange}
            style={{ marginRight: '10px', width: '200px' }}
          />
        </Grid>
        <Grid item>
          <TextField
            label="Team Number"
            variant="outlined"
            value={teamNumber}
            onChange={handleTeamNumberChange}
            style={{ marginRight: '10px', width: '200px' }}
          />
        </Grid>
        <Grid item>
          <Button variant="contained" onClick={handleSearch} style={{ backgroundColor: '#007bff', color: 'white' }}>
            Search
          </Button>
        </Grid>
      </Grid>
      {responseMessage && (
        <Typography variant="body1" align="center" style={{ color: responseMessage.includes('Error') ? '#dc3545' : '#28a745', marginTop: '20px' }}>
          {responseMessage}
        </Typography>
      )}
      {records.length > 0 && (
        <TableContainer component={Paper} style={{ marginTop: '20px' }}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell align="center">Match Number</TableCell>
                <TableCell align="center">Team Number</TableCell>
                <TableCell align="center">Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {records.map((record, index) => (
                <TableRow key={index}>
                  <TableCell align="center">{record.matchNumber}</TableCell>
                  <TableCell align="center">{record.teamNumber}</TableCell>
                  <TableCell align="center">
                    <Button
                      variant="contained"
                      color="secondary"
                      onClick={() => handleDelete(record.matchNumber)}
                    >
                      Delete
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
    </Container>
  );
};

export default RemoveDataScreen;
